import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar'

function Home() {
  return (
    <div className="home-container">
      <Navbar/>
      <div className="welcome-header">
        <p> Infinite Memories.</p>
        <p> Zero Stress. </p>
      </div>
    </div>
  );
}

export default Home;
